,p_plug_name=>'Interactive Report'
,p_region_template_options=>'#DEFAULT#:t-IRR-region--hideHeader js-addHiddenHeadingRoleDesc'
,p_component_template_options=>'#DEFAULT#'
,p_plug_template=>2100526641005906379
,p_plug_display_sequence=>10
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
'    a.animal_id,',
'    a.name,',
'    a.species,',
'    a.breed,',
'    a.gender,',
'    calculate_animal_age(a.animal_id) as age_years,',
'    a.status,',
'    s.shelter_name,',
'    a.intake_date,',
'    a.microchip_number',
'FROM Animals a',
'JOIN Shelters s ON a.shelter_id = s.shelter_id',
'WHERE (:P2_SEARCH IS NULL ',
'    OR UPPER(a.name) LIKE ''%'' || UPPER(:P2_SEARCH) || ''%''',
'    OR UPPER(a.species) LIKE ''%'' || UPPER(:P2_SEARCH) || ''%''',
'    OR UPPER(a.breed) LIKE ''%'' || UPPER(:P2_SEARCH) || ''%'')',
'ORDER BY a.intake_date DESC'))
,p_plug_source_type=>'NATIVE_IR'
,p_ajax_items_to_submit=>'P2_SEARCH'
,p_prn_content_disposition=>'ATTACHMENT'
,p_prn_units=>'INCHES'
,p_prn_paper_size=>'LETTER'
,p_prn_width=>11
,p_prn_height=>8.5
,p_prn_orientation=>'HORIZONTAL'
