,p_process_name=>'Delete Animal'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_count NUMBER;',
'BEGIN',
'    -- Check if animal exists',
'    SELECT COUNT(*) INTO v_count',
'    FROM Animals',
'    WHERE animal_id = :P4_DELETE_ID;',
'',
'    IF v_count = 0 THEN',
'        RAISE_APPLICATION_ERROR(-20001, ''Animal ID not found'');',
'    END IF;',
'',
'    -- Check if animal has adoptions',
'    SELECT COUNT(*) INTO v_count',
'    FROM Adoptions',
'    WHERE animal_id = :P4_DELETE_ID',
'    AND status IN (''Pending'', ''Approved'', ''Completed'');',
'',
'    IF v_count > 0 THEN',
'        RAISE_APPLICATION_ERROR(-20002, ''Cannot delete: Animal has adoption records'');',
'    END IF;',
'',
'    -- Delete related records first',
'    DELETE FROM Vaccinations WHERE animal_id = :P4_DELETE_ID;',
'    DELETE FROM Medical_Records WHERE animal_id = :P4_DELETE_ID;',
'    DELETE FROM Treatments WHERE animal_id = :P4_DELETE_ID;',
'    DELETE FROM Appointments WHERE animal_id = :P4_DELETE_ID;',
'    ',
'    -- Delete animal',
'    DELETE FROM Animals WHERE animal_id = :P4_DELETE_ID;',
'',
'    COMMIT;',
'    apex_application.g_print_success_message := ''Animal deleted successfully!'';',
'EXCEPTION',
'    WHEN OTHERS THEN',
'        ROLLBACK;',
'        apex_error.add_error(',
'            p_message => SQLERRM,',
'            p_display_location => apex_error.c_inline_in_notification',
'        );',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(117848711385776048849)
